import React from 'react'
import { Container } from 'reactstrap'

function Admin() {
    return (
        <div>
            <h1>Панель управления</h1>
            <Container className='d-flex flex-column align-items-left'>
                <h3>Управление кабинетами</h3>
            </Container>
           
        </div>
    )
}

export default Admin
